import React from "react"

export default function Navbar() {
    return(
        <header className="navbar">
            <h1 className="navbar--title">natsukashii</h1>
            <ul className="navbar--items">
                <li>Contact</li>
                <li>Stories</li>
                <li>Share</li>
            </ul>
        </header>
    )
}
